import React, { useState } from 'react';

import Login from './pages/Login/index'

function App() {
  const [counter, setCounter] = useState(0);

  function increment() {
    setCounter(counter + 1);
  }

  return (
    <div>
      <Login></Login>
    </div>
  );
}

export default App;
